import axios from "axios";
import Cookies from "js-cookie";
import { getCSRF } from "../auth/authService";

const DEVICE_URL = 'device/'


async function getMy(userData) {
    const config = await getCSRF()
    const response = await axios.get(DEVICE_URL + 'get', userData, config)
    return response.data
}

async function register(userData) {
    const config = await getCSRF()
    const response = await axios.post(DEVICE_URL + 'register', userData, config)
    return response.data
}

async function remove(userData) {
    const config = await getCSRF()
    const response = await axios.post(DEVICE_URL + 'delete', userData, config)
    return response.data
}

const deviceService = {
    getMy,
    register,
    remove
}

export default deviceService
